INSERT INTO `static_content` VALUES (1,'ROMANCE','Light up the fire under your Valentine with these cute and romantic valentine poems. Make sure valentine.s day becomes the brightest star of the year. Let it shine the spotlight of love excellent and desired by all.','2014-12-21 12:24:57'),(2,'ROMANCE','Girl: Why my name is always on your Facebook status in every 2 minutes? Boy: Facebook keeps asking me what\'s on my mind ? And honestly, it\'s always you.','2014-12-21 12:24:57'),(3,'ROMANCE','Can i take your photo? girl: what for? boy: so that i can show santa claus what i want for christmas.','2014-12-21 12:24:57'),(4,'ROMANCE','Anyone Can Make You Smile, Many People Can Make You Cry, But It Takes Someone Really Special To Make You Smile With Tears In Your Eyes.','2014-12-21 12:24:57'),(5,'ROMANCE','Beautiful lines by a lover.... . The Next Gal I\"ll ever love will be our Daughter.','2014-12-21 12:24:57'),(6,'ROMANCE','nice words by a boy who truly loves a girl.......... \'my 1 hand is enough 2 fight against the world if u hold d another one.','2014-12-21 12:24:57'),(7,'ROMANCE','Last night when I was thinking of you, A tear of mine rolled out.. \'\'Why did you roll out???\'\' I asked A reply came. \'\' I can\'t find any space for me coz there\'s someone so beautiful there.','2014-12-21 12:24:57'),(8,'ROMANCE','One Day You Asked Me, Whether I Love You More Or My Life And I Said \'\' My Life \'\' You Walked Away With Tears In Your Eyes Without Knowing That You Are \'\' My Life.','2014-12-21 12:24:57'),(9,'ROMANCE','Love warms your soul and makes life easy, enjoyable and worthwhile.','2014-12-21 12:24:58'),(10,'ROMANCE','Love is a positive state of being so powerful that it can overshadow even the dreariest of circumstances.','2014-12-21 12:24:58'),(11,'ROMANCE','I feel so safe In your embrace You fill me with faith, Peace, love and grace.','2014-12-21 12:24:58'),(12,'ROMANCE','You are my love From now till death I thank stars above For your faithfulness.','2014-12-21 12:24:58'),(13,'ROMANCE','My heart is broken My love is your token To find all my charms  Hold me in your arms.','2014-12-21 12:24:58'),(14,'ROMANCE','It\'s finally Valentine\'s Day I have been waiting all year Now I can sneak a kiss and play And keep my intentions near.','2014-12-21 12:24:58'),(15,'ROMANCE','It is Valentine\'s Day So what do you say? Will you give me a kiss? You cute little miss? ','2014-12-21 12:24:58'),(16,'ROMANCE','Don\'t pass up your chance, We can dine and dance. We can roam the town Until the sun goes down.','2014-12-21 12:24:58'),(17,'ROMANCE','Please be mine Be my Valentine. Not for one day, But forever stay.','2014-12-21 12:24:58'),(18,'ROMANCE','Love is true. Love is golden. Love for you My beholden.','2014-12-21 12:24:58'),(19,'ROMANCE','Your love is like the ocean, Vast, spacious and deep. You have given me your potion Of love that I must keep.','2014-12-21 12:24:58'),(20,'ROMANCE','I am collecting Valentines Some red, some green, some blue, Some big, some small, all very fine And I am going to give them all to you.','2014-12-21 12:24:58'),(21,'ROMANCE','Valentine dear, I want you true. Praying Cupid will get his bow, Pull back his arrow, aim it at you So love for me you will know.','2014-12-21 12:24:58'),(22,'ROMANCE','Your love is so pure, Whitest of whites. Teddy bear\'s fur And cleanest of nights.','2014-12-21 12:24:58'),(23,'ROMANCE','It is All Hearts Day With flowers all around. Please tell me, just say You will always be \'round.','2014-12-21 12:24:58'),(36,'MCHONG','Uko na shoulders broad hadi ukidance helicopter unatake off.','2014-12-21 12:34:21'),(37,'MCHONG','Uko down hadi ulikuwa unafikiria Youtube ni contraceptive.','2014-12-21 12:34:21'),(38,'MCHONG','Wee ni mu ugly hadi ukiwa mtoi mama yako alikuwa anakushow, kula ama nilete kioo.','2014-12-21 12:34:21'),(39,'MCHONG','Wee ni mrough hadi ukiguza mouse comp inashow NEW HARDWARE DETECTED.','2014-12-21 12:34:21'),(40,'MCHONG','Uko na kichwa biggy ukingia daro mode anakusho